import Home from "./pages/Home";

function App() {
  return (
    <div className="App">
   <table>
     <th>No</th>
     <th>Provinsi</th> 
     <th>Positif</th>
     <th>Sembuh</th>
     <th>Dirawat</th>
     <th>Meninggal</th>
   </table>

      <Home />
    </div>
  );
}

export default App;
